window.bookSummaryJSON = "<p><b>Deception. Demons are experts at it. </b></p> <p>I thought I could control my fate. I thought I could send the Master of Demon Runes back to the Underworld where he belongs, but instead, I'm the one forced into a dangerous game of elimination. </p> <p>Now I must fight for my life against the strongest demons—demons who have waited their whole lives for the chance to rule the Underworld. </p> <p>My only chance at survival is to trust the most dangerous man of all. An ancient, ruthless demon with unlimited power and deadly secrets who wants to claim my heart and my body. </p> <p><b>Illusion. The Underworld is built on it.</b></p> <p>He pulls me into his world and promises me everything I could desire, but how can I trust him when death waits for me and my family with every step I take? I won't risk the people I love. Not for anything.</p> <p>My whole life I've fought the darkness growing within me, but if protecting my sisters and my demon wolves means embracing the nightmares of my power, then so be it.</p> <p>Demons may be experts at deception. The Underworld may be filled with illusions that threaten to break me. But my power is growing, and soon...I will be their nightmare.</p> <p><b>Let the </b><b><i>Elimination</i></b><b> begin.</b></p> <p><b><i>Elimination</i></b><b> is a full-length (108,000 words), dark and sexy paranormal romance, the second in the Demon Pack series. It’s recommended for 18+ due to language, mature themes, and sexual situations. Ends on a cliff-hanger.</b></p>"; 
